import React from 'react';
import './App.css';

const App = () => <PersonList />

const PersonList=() => {

  const People = [
    {
      img : 'cristian',
      name: 'Cristian Sipahutar',
      job: 'Mechanical Engineering'
    },
    {
      img : 'david',
      name: 'David Andrianus Hutapea',
      job: 'Senior Software Engineer'
    },
    {
      img : 'thompson',
      name: 'Thompson Nainggolan',
      job: 'Senior Developer'
    },
  ];

  return 
    <section>
      <Person person={People[0]}/>
      <Person person={People[1]}/>
      <Person person={People[2]}/>
    </section>
}

const Person = (props) => {
  const imgsrc = './files/cristian Cropped.jpg';
  return (
    <div className='person'> 
      <img src={imgsrc} alt='' />
      <div>
        <h4>Name</h4>
        <h4>Job</h4>
      </div>
    </div>
  )
}

export default App;
